        <div className="carousel-inner">
          <div className="carousel-item active">
            <img className="d-block w-100" src={require("../images/mother.png")} alt="First slide" />
          </div>
          <div className="carousel-item">
            <img className="d-block w-100" src={require("../images/bluehour.png")} alt="Second slide" />
          </div>
          <div className="carousel-item">
            <img className="d-block w-100" src={require("../images/curse.png")} alt="Third slide" />
          </div>
          <div className="carousel-item">
            <img className="d-block w-100" src={require("../images/pitbulls.png")} alt="fourth slide" />
          </div>
          <div className="carousel-item">
            <img className="d-block w-100" src={require("../images/killerKids.png")} alt="fifth slide" />
          </div>
          <div className="carousel-item">
            <img className="d-block w-100" src={require("../images/nightwatch.png")} alt="Sixth slide" />
          </div>
          <div className="carousel-item">
            <img className="d-block w-100" src={require("../images/allSummer.png")} alt="seventh slide" />
          </div>
          <div className="carousel-item">
            <img className="d-block w-100" src={require("../images/winter.png")} alt="eigth slide" />
          </div>


        </div>
        <a className="carousel-control-prev" href="#carouselExampleControls" role="button" data-slide="prev">
          <span className="carousel-control-prev-icon" aria-hidden="true"></span>
          <span className="sr-only">Previous</span>
        </a>
        <a className="carousel-control-next" href="#carouselExampleControls" role="button" data-slide="next">
          <span className="carousel-control-next-icon" aria-hidden="true"></span>
          <span className="sr-only">Next</span>
        </a>
      </div>
    );
  }
}
